.
.
.
이번에 호주에 한화에서 에뮤 전쟁은 1932년 호주에서 호주군이 전개한 에뮤 소탕 작전으로, 세상에서 가장 황당한 전쟁(?)으로 손꼽히는 군사작전이다. 많은 수의 에뮤를 사살했지만 그 효과가 매우 미미한데다 여론의 반대로 인해 호주 정부는 패배를 인정하였고 작전은 실패로 끝났다.
⠀
깃털이 몇 겹은 덮여있는 몸체라 이 몇 겹의 깃털들이 기관총 탄환들을 막아주는 천연 방탄복 역할을 하니 여러 발은 갈겨줘야 한 마리가 죽을까 말까 했다. 그런데다 시속 60km에 달하는 속도로 질주할 수 있기에 쉽게 잡힐 리가 없고, 그나마 치명타를 줄 수 있는 부분인 머리와 다리는 가늘어서 총에 잘 맞지도 않았다.
⠀
이후 2020년에는 2019-2020 호주 산불과 맞물려서 낙타와의 전쟁(?)을 선포했다. 낙타 또한 토끼와 마찬가지로 사육용으로 들여온게 야생으로 퍼진 것인데, 호주에는사실상 낙타의 천적이 없는 상태라서 낙타의 수가 어마어마하게 불어났다. 하지만 이 전쟁 역시 기간은 겨우 5일이었고, 100만 마리 중 1만 마리를 사살하는 정도에 그쳐서, 이번에도 사실상 호주의 참패. 사실 낙타도 토끼 못지않게 호주에서 꽤 말썽인 동물인지라, 가망도 없는 전쟁을 반복해야만 하는 호주의 운명이 그저 안쓰러울 뿐이다.
